[TAB]Фиброзный заапикальный очаг рентгенографический признак хронического верхушечного периодонтита —воспалительное заболевание околокорневых тканей, вызванное возбудителями эндодонтического происхождения. Возникает, когда лечение корневых каналов не приводит к адекватному устранению внутрикорневой инфекции.
[TAB]Даже при выполнении самых строгих процедур апикальный периодонтит может по-прежнему сохраняться в виде бессимптомных просветлений из-за сложности системы корневых каналов, образованной основными и дополнительными каналами, их разветвлениями и анастомозами, где может сохраняться остаточная инфекция. Так же, существуют внекорневые факторы, которые могут препятствовать заживлению апикального очага после лечения. Причины апикального периодонтита, сохраняющегося после лечения корневых каналов, до конца не изучены. Серия исследований, проведенных в 1990-х годах, показала, что существует шесть биологических факторов, которые приводят к формированию бессимптомного фиброзного очага:
[TAB1]1. Внутрикорневая инфекция, сохраняющаяся в сложной системе апикальных корневых каналов;
2. Внекорневая инфекция, как правило, в форме периапикального актиномикоза (заапикальное грибковое поражение);
3. Утратившая герметичность реставрация корневого канала;
4. Накопление кристаллов эндогенного холестерина, раздражающих периапикальные ткани;
5. Истинные кистозные образования;
6. Заживление костной ткани, после успешного лечения заапикального поражения.
[TAB0][TAB]Варианты лечения могут включать:
[TAB1]• рентгенографическое наблюдение за очагом (контроль отсутствия роста), в некоторых случаях допустимо сохранение очага, при отсутствии роста и симптомов (боль, припухлость и чувство выросшего зуба).
• лечение корневых каналов, очистка и стерилизация корневых каналов с последующей их герметичной обтурацией.
• эндодонтическая хирургия – хирургическое вмешательство, направленное на санацию воспалительного очага, удаления грануляционной ткани и создания условий для заживления.
• экстракцию зуба (удаление зуба).
